/* Styles */
import classes from "./Footer.module.css";
/* End Styles */

function Footer(){

    const theme = createTheme({
        palette: {
          c_primary: {
            main: "#455a64",
            contrastText: "#fff",
          },
          c_button: {
            main: "#fff",
          },
        },
      });

    return(
        <div className={classes.wrapper}>
            <div className={classes.content}>Aesthetic Productions</div>
        </div>
    );
}

export default Footer;
